import { Card } from "react-bootstrap";
import propTypes from 'prop-types';

import '../styles/Product.css';

function Product({ item }) {
  return (
    <section className="product">
      <Card className="product__card" style={{ width: '12rem' }}>
        <Card.Img className="product__image" src={item.thumbnail} alt={item.title}/>
        <Card.Body>
          <Card.Title className="product__title">{item.title}</Card.Title>
          <Card.Text>R$ {item.price}</Card.Text>
        </Card.Body>
      </Card>
    </section>
  )
}

Product.propTypes = {
  item: propTypes.shape({
    thumbnail: propTypes.string.isRequired,
    title: propTypes.string.isRequired,
    price: propTypes.number.isRequired,
  }).isRequired,
};



export default Product;
